CREATE DEFINER=`admin`@`%` PROCEDURE `insert_attendance_by_period` (IN `user_id` VARCHAR(8))  MODIFIES SQL DATA
BEGIN

	DECLARE start_period TINYINT(6);
	DECLARE end_period TINYINT(6);
	DECLARE start_date DATE;
	DECLARE end_date DATE;
	DECLARE curr_date DATE;
	DECLARE i INT(2);
	
	
	CREATE TEMPORARY TABLE IF NOT EXISTS temp_dates(Date date);
	DELETE from temp_dates;
	set i = 0;
	
	SELECT start_periode,end_periode INTO start_period,end_period from setting;
	
	IF DAY(CURRENT_DATE) >= start_period THEN
		set start_date = DATE(concat(YEAR(CURRENT_DATE),'-',MONTH(CURRENT_DATE),'-',start_period));
	ELSE 
		IF MONTH(CURRENT_DATE) = 1 THEN
			set start_date = DATE(concat(YEAR(CURRENT_DATE)-1,'-',12,'-',start_period));
		ELSE
			set start_date = DATE(concat(YEAR(CURRENT_DATE),'-',MONTH(CURRENT_DATE)-1,'-',start_period));
		END IF;
	END IF;
	
	
	#TRUNCATE TABLE temp_dates;
	
	set end_date = DATE_ADD(DATE_ADD(start_date,INTERVAL 1 MONTH),INTERVAL -1 DAY);
	set curr_date=start_date;
	
	WHILE i < TIMESTAMPDIFF(DAY,start_date,end_date)+1 AND curr_date < CURRENT_DATE DO
		set curr_date = DATE_ADD(start_date,INTERVAL i DAY);
		#SELECT curr_date;
		set i = i + 1;
	END WHILE;
		
	#SELECT * from temp_dates;
	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_daily_attendance` ()  BEGIN
    DECLARE today_date DATE;
    SET today_date = CURDATE();

    -- Hanya insert jika belum ada data untuk tanggal hari ini
    SELECT 
uuid(), e.user_id_machine, CONCAT(today_date, ' 00:00:00'),CONCAT(today_date, ' 00:00:00'),
null,null,'','',''
    FROM 
        employee e
    WHERE status = 'Aktif' AND
		NOT EXISTS (
        SELECT 1 FROM attendance a
        WHERE DATE(a.check_in) = today_date
        AND a.user_id_machine = e.user_id_machine
    );
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `procedure_skpd_insert_attendance` (IN `payroll` VARCHAR(8), IN `start_date` DATE, IN `end_date` DATE, IN `description` VARCHAR(255))  BEGIN
	DECLARE date_now DATE;
    
    SET date_now = start_date;
    
    WHILE date_now <= end_date DO
        SELECT UUID(), user_id_machine, date_now, date_now, "Dinas", description from employee where payroll = payroll;
            
        SET date_now = DATE_ADD(date_now, INTERVAL 1 DAY);
    END WHILE;
END$$

